import axios from 'axios';
import React, { useEffect } from 'react';

function Rows({ movieTitle, fetchUrl }) {
  useEffect(() => {
    async function movieData() {
      const request = await axios.get(fetchUrl);
      console.log(request);
    }
  }, []);
  return <div></div>;
}

export default Rows;
